import React from "react";
import './footer.css';

const Footer = () => {
    return (
        <div className="ccs__footer section__footer section__padding" id="contactus">
            <h1>Website made and managed by Lone Peak Software Solutions</h1>
            <h2> www.lonepeakss.tech</h2>
        </div>
    )
}
export default Footer
